import styled from "styled-components";

export const Wrapper = styled.div `
	{	
        height: 100vh;
        width: 100vw;
		background-color: #3776ab;

	}
`;

export const Content = styled.div `
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 100%;

`;

export const WelcomeMessage = styled.div `
	flex:1;
	padding-top: 2em;
	height: 5em;
	align-content: left;
	h2 {
		align-items: left;
		max-width: 12em;
		max-height: 2em;
		margin: 0;
	}
`;
